import React from 'react';
import './App.css';
import Numerics from "./components/Numerics"
import Result from "./components/Result"

class App extends React.Component{
  render(){
    return (
      <div>
        <Result></Result>
        <Numerics></Numerics>
      </div>
    )
  }
}
export default App;
